  "Dragon",
  "Fairy",
  "Fish",
  "Insect",
  "Machine",
  "Plant",
  "Rock",
  "Warrior",
  "Spellcaster"
];

function Home() {
  return (
    <div className='container-app'>

        {TYPES.map((type) => 
        <div className='category-item'>{type}
        <Link to={`/Cards/`}></Link>

        </div>)}

